import {
  Search,
  Menu,
  User,
  ChevronRight,
  Star,
  MapPin,
  Stethoscope,
  Calendar,
  Bell,
} from 'lucide-react';

const HomeUI = ({ doctors, specialties, facilities }) => {
    <section>
  <h2 className="text-2xl font-bold mb-6">Bác sĩ nổi bật</h2>

  {(!doctors || doctors.length === 0) ? (
    <div className="text-slate-500 italic">Chưa có dữ liệu bác sĩ</div>
  ) : (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
      {doctors.map(doc => (
        <div key={doc.id} className="bg-white p-6 rounded-2xl text-center">
          <h3 className="font-bold">{doc.name}</h3>
          <p className="text-blue-600 text-sm">{doc.specialtyName}</p>
          <div className="flex justify-center gap-1">
            <Star size={16} />
            {doc.rating}
          </div>
          <button className="mt-3 bg-blue-600 text-white px-4 py-2 rounded">
            <Calendar size={16} className="inline mr-1" />
            Đặt lịch khám
          </button>
        </div>
      ))}
    </div>
  )}

  <h2 className="text-2xl font-bold mb-6">Cơ sở y tế nổi bật</h2>

  {(!facilities || facilities.length === 0) ? (
    <div className="text-slate-500 italic">Chưa có dữ liệu cơ sở y tế</div>
  ) : (
    <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
      {facilities.map(item => (
        <div key={item.id} className="bg-white rounded-2xl overflow-hidden">
          <img src={item.imageUrl} alt={item.name} />
          <div className="p-4">
            <h3 className="font-bold">{item.name}</h3>
            <div className="flex text-sm text-slate-500">
              <MapPin size={14} className="mr-1" />
              {item.address}
            </div>
          </div>
        </div>
      ))}
    </div>
  )}

  <h2 className="text-2xl font-bold mb-6">Bác sĩ nổi bật</h2>

  {(!doctors || doctors.length === 0) ? (
    <div className="text-slate-500 italic">Chưa có dữ liệu bác sĩ</div>
  ) : (
    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6">
      {doctors.map(doc => (
        <div key={doc.id} className="bg-white p-6 rounded-2xl text-center">
          <h3 className="font-bold">{doc.name}</h3>
          <p className="text-blue-600 text-sm">{doc.specialtyName}</p>
          <div className="flex justify-center gap-1">
            <Star size={16} />
            {doc.rating}
          </div>
          <button className="mt-3 bg-blue-600 text-white px-4 py-2 rounded">
            <Calendar size={16} className="inline mr-1" />
            Đặt lịch khám
          </button>
        </div>
      ))}
    </div>
  )}
</section>

}
